import React, { useState, useEffect } from 'react'
// import houselisting from '../assets/mocks/data'
import ListingCard from '../components/ListingCard'
import MapContainer from '../components/MapContainer'
import sf_housing_data from '../assets/mocks/sf_housing_data.json'

export default function Listing() {

    const [showMap, setShowMap] = useState(true);
    let results;
    let house_results;
    const [houseCompareTable, setHouseCompareTable] = useState([]);

    if (sf_housing_data.length > 0) {
      // results = houselisting.map((house, index) => 
      // <ListingCard key={house.sys.id} {...house} />);

      results = sf_housing_data.map ((houses) =>
      // <ListingCard key={houses} {...house} />);
       {
          // if (!!houses.zpid) {
          //   //with zpid
          //   return  <ListingCard key={houses.zpid} {...houses} 
          // houseCompareTable={houseCompareTable} setHouseCompareTable={setHouseCompareTable}/>
          // } else {
          //   //with buildingId
          // return <ListingCard key={houses.buildingId} {...houses} 
          // houseCompareTable={houseCompareTable} setHouseCompareTable={setHouseCompareTable}/>
          // }

          if (!!houses.zpid) {
            //with zpid
            return  <ListingCard key={houses.zpid} house={houses}
            houseCompareTable={houseCompareTable} setHouseCompareTable={setHouseCompareTable}/>
          } else {
            //with buildingId
            return <ListingCard key={houses.buildingId} house={houses}
            houseCompareTable={houseCompareTable} setHouseCompareTable={setHouseCompareTable}/>
          }
       }

      );
    } else {
      results = (
        <div>
          <h2>Sorry!</h2>
          <h3> No listings available yet.</h3>
        </div>
      );
    }






    return ( 
      <div className="listings">
         {/* Nav - Filters */}
       <div className="relative px-6 py-3 bg-themeGreen flex items-center content-center">
        <div>
          <p className="font-light text-gray-900">Searching rooms in:</p>
          <h1 className="font-bold text-2xl text-gray-900">{selectedCity}</h1>
        </div>
       {/* <div
          onClick={() => setShowMap(!showMap)}
          className="absolute inset-y-0 right-0 m-3 cursor-pointer bg-white rounded-full w-16 h-16 flex items-center justify-center border shadow-xl border-teal-200 lg:hidden"
        >
          {showMap ? (
            <FiList className="text-2xl text-teal-600" />
          ) : (
            <FiMap className="text-2xl text-teal-600" />
          )}
        </div>*/}
      </div>


      {/* </div>  <div id="content" style={{ display: "flex" }}> */}
        <div id="content" style={{ display: "flex" }}>
          {/* <div className="listings-container" style={{ flex: "50%" }}> */}
          <div className="listings-container" >
            {results}
          </div>

          {/* <div className="map-container" style={{ flex: "50%" }}> */}
          <div className="map-container" style={{ flex: "30%" }}>
            <MapContainer />
          </div>
        </div>
      </div>
  )
}
